import classNames from "classnames/bind";

import styles from "./Create.module.scss";
import Input from "../../../../components/Input";
import Button from "../../../../components/Button";
import { useState } from "react";

const cx = classNames.bind(styles)

function MoreSkills({title}) {

    const [data, setData] = useState([]);
    const [Name, setName] = useState("");
    const [Percentage, setPercentage] = useState("");

    const handleUpData = () => {
        setData({"Name": Name, "Percentage": Percentage});
        console.log("Name: ", Name);
        console.log("Percentage: ", Percentage);
        console.log("data: ", data);
    }

    return (
        <section className={cx("warpper")}>
            <section className={cx("container")}>
                <section className={cx("input_item")}>
                    <Input
                        name="Name Skills"
                        id="Name"
                        required={true}
                        type="text"
                        onChange={(e) => {setName(e.target.value)}}
                    />
                    <Input
                        name="Percentage"
                        id="Percentage"
                        required={true}
                        type="number"
                        max="100"
                        min="0"
                        onChange={(e) => {setPercentage(e.target.value)}}
                    />
                    <Button
                        name="Create Skills"
                        width= "25%"
                        height= "45px"
                        onClick={() => {handleUpData()}}
                    />
                </section>
                <section className={cx("list-skills")}>
                    <table className={cx("table")}>
                        <thead>
                            <tr>
                                <th>Name Skills</th>
                                <th>Percentage</th>
                                <th>Action</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>Name Skills</td>
                                <td>Percentage</td>
                                <td><button className={cx("Delete")}>Delete</button></td>
                            </tr>
                        </tbody>
                    </table>
                </section>
            </section>
        </section>
    )
}

export default MoreSkills;
